import React from 'react';
import logo from './logo.svg';
import './App.css';
let count = 0;
const element = <h1>{count}</h1>;

function plusCount (count){
  console.log(count = count + 1);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section class="couner-container">
          {count}
          <div>
          <button onClick={plusCount} >+</button>
          <button>-</button>
        </div>
        </section>
      </header>
    </div>
  );
}

var dynamicData = 0;
setInterval(()=>{
    dynamicData = 0; // ???
}, 3000);

var Hello = React.createClass({
  render: function() {
    return <h2>{this.props.test}</h2>;
  }
});

React.render(
  <Hello test={dynamicData} />,
  document.getElementById('container')
);

export default App;
